        <Route path="*" element={<Navigate to="/" />} />
        {/* <Route path="/me/change-password" element={<ProtectedRoute allowedRoles={['ROLE_USER']}><ChangePassword /></ProtectedRoute>} /> */}
      </Routes>
    </Router>
  );
};

export default AppRouter;
